snippet.textDisplay:
Ou a humanidade acabará por Inteligência Artificial, Guerras Atômicas, Aquecimento Global em menos tempo, 

ou ela acabará por causa de uma irupção Solar daqui a 5 Bilhões de anos; 

A única certeza é que nossa espécie e todos seus indivíduos certamente morrerão.

